import React, { useEffect, useState } from 'react';

const ProfilePage = () => {
  const email = localStorage.getItem("userEmail");
  const [user, setUser] = useState(null);
  const [editMode, setEditMode] = useState(false);
  const [form, setForm] = useState({ name: '', role: '' });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    if (!email) {
      setError('No email found in localStorage');
      setLoading(false);
      return;
    }

    fetch(`http://localhost:8081/api/auth/email/${email}`)
      .then(res => {
        if (!res.ok) throw new Error("Failed to fetch user");
        return res.json();
      })
      .then(data => {
        setUser(data);
        setForm({ name: data.name, role: data.role });
        setLoading(false);
      })
      .catch(err => {
        console.error(err);
        setError('Failed to load profile.');
        setLoading(false);
      });
  }, [email]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm(prev => ({ ...prev, [name]: value }));
  };

  const handleUpdate = async () => {
    try {
      const res = await fetch(`http://localhost:8081/api/auth/email/${email}`, {
        method: 'PUT',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ ...user, ...form }),
      });

      if (res.ok) {
        alert('Profile updated successfully');
        setEditMode(false);
        setUser(prev => ({ ...prev, ...form }));
      } else {
        alert('Update failed');
      }
    } catch (err) {
      alert('Server error');
      console.error(err);
    }
  };

  if (loading) return <p style={{ textAlign: 'center' }}>Loading profile...</p>;
  if (error) return <p style={{ color: 'red', textAlign: 'center' }}>{error}</p>;

  return (
    <div style={{
      padding: '20px',
      maxWidth: '400px',
      margin: '40px auto',
      border: '1px solid #ccc',
      borderRadius: '12px',
      boxShadow: '0 4px 12px rgba(0,0,0,0.1)',
      background: '#f9f9f9',
    }}>
      <h2 style={{ textAlign: 'center', color: '#007bff' }}>User Profile</h2>
      <p><strong>Email:</strong> {user.email}</p>

      {editMode ? (
        <>
          <label style={{ marginTop: '10px' }}>Name:</label>
          <input
            name="name"
            value={form.name}
            onChange={handleChange}
            style={{
              width: '100%',
              padding: '8px',
              marginBottom: '10px',
              borderRadius: '6px',
              border: '1px solid #ccc',
            }}
          />

          <label>Role:</label>
          <select
            name="role"
            value={form.role}
            onChange={handleChange}
            style={{
              width: '100%',
              padding: '8px',
              marginBottom: '10px',
              borderRadius: '6px',
              border: '1px solid #ccc',
            }}
          >
            <option value="CLIENT">CLIENT</option>
            <option value="FREELANCER">FREELANCER</option>
          </select>

          <button
            onClick={handleUpdate}
            style={{
              padding: '10px',
              width: '100%',
              background: '#007bff',
              color: 'white',
              border: 'none',
              borderRadius: '6px',
              fontWeight: 'bold',
              cursor: 'pointer',
            }}
          >
            Save
          </button>
        </>
      ) : (
        <>
          <p><strong>Name:</strong> {user.name}</p>
          <p><strong>Role:</strong> {user.role}</p>
          <button
            onClick={() => setEditMode(true)}
            style={{
              padding: '10px',
              width: '100%',
              background: '#28a745',
              color: 'white',
              border: 'none',
              borderRadius: '6px',
              fontWeight: 'bold',
              cursor: 'pointer',
            }}
          >
            Edit
          </button>
        </>
      )}
    </div>
  );
};

export default ProfilePage;
